USE BODEGAS_SCMIALVARADO
 
SELECT SUBSTRING(a.BOPRO_CODIGO,1,14) AS Articulo
,(SELECT z.BOPRO_DESCRIPCION FROM BO_PRODUCTO z WITH(nolock) WHERE z.BOPRO_CODIGO = a.BOPRO_CODIGO AND BOPRO_CODIGOBODEGA = '01') AS Descripcion
,SUM(A.BOAUB_CANTIDAD) AS 'CantidadWMS' 
,(select rtrim(x.BOAUB_USUARIO)  +' - '+
isnull((select top 1 (select w.ADUSU_USUARIO from AD_USUARIO w where w.ADUSU_CODIGO  = y.CCIDG_USUARIO) from CC_INVENTARIODETALLADOGRUPOCONTROL y where y.CCGCO_CODIGO like '%'+ RIGHT(x.BOAUB_USUARIO,4) + '%' and y.BOPRO_CODIGO = x.BOPRO_CODIGO and y.BOCOO_CODIGO = x.BOCOO_COORDENADADESTINO),'')
 +' - '+rtrim(x.BOCOO_COORDENADADESTINO) +' - Conto: ' + cast(x.BOAUB_CANTIDAD as nvarchar(15)) + ' / '
from BO_ASIGNACIONUBICACION X  where x.BOPRO_CODIGO = a.BOPRO_CODIGO AND x.BOAUB_TIPOPROCESO = 'Despacho' AND  x.BOBOD_BODEGADESTINO = '01'  FOR XML PATH ('') ) as Ubicacion
--,(SELECT z.BOMAR_CODIGO FROM BO_PRODUCTO z WITH(nolock) WHERE z.BOPRO_CODIGO = a.BOPRO_CODIGO AND BOPRO_CODIGOBODEGA = '01') AS Marca
,(SELECT F.CURRCOST FROM [192.168.0.222].GPIAV.dbo.IV00101 F WITH(nolock) WHERE SUBSTRING(A.BOPRO_CODIGO,1,14) COLLATE Modern_Spanish_CI_AS = F.ITEMNMBR) AS Costo
,(SELECT B.QTYONHND - b.ATYALLOC FROM [192.168.0.222].GPIAV.dbo.IV00102 B WITH(nolock) WHERE SUBSTRING(A.BOPRO_CODIGO,1,14) COLLATE Modern_Spanish_CI_AS = B.ITEMNMBR  
AND B.LOCNCODE = 'MATRIZ') CantidadMatriz
FROM BO_ASIGNACIONUBICACION A WITH(nolock) WHERE A.BOBOD_BODEGADESTINO = '01' 
AND a.BOAUB_TIPOPROCESO = 'Despacho'
GROUP BY a.BOPRO_CODIGO
UNIOn all
SELECT X.ITEMNMBR,X.QTYONHND
,(SELECT F.CURRCOST FROM [192.168.0.222].GPIAV.dbo.IV00101 F WITH(nolock) WHERE X.ITEMNMBR = F.ITEMNMBR) AS Costo 
